// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0; //safe math not needed

import "./IERC20.sol";
import "./PetToken.sol";
import "./VirtualPet.sol";

contract ATM {

    IERC20 public token;
    address private owner;
    //100 token = 1 ether
    uint public constant TOKEN_PRICE_BUY = 100;
    uint public constant TOKEN_PRICE_SELL = 100;
    uint public constant BASIC_PET_PRICE = 10;

    enum TradeState{NONE, REQUEST, DONE}

    struct Trade { 
        address tradePartner;
        address pet;
        uint price;
    }

    mapping(address => address[]) public pets;
    mapping(address => mapping (address => bool)) private petOfUser;

    //TO - FROM (Buyer - Seller) to avoid multiple offers
    mapping(address =>  mapping(address => bool)) private activeTrade;

    //store all trades
    mapping(address => Trade[]) public sellerTrades;
    mapping(address => Trade[]) public buyerTrades;

    //FROM - TO - VALUE - PET
    mapping(address => mapping (address => mapping (address => mapping (uint => TradeState)))) private petTrade;

    event Bought(uint256 amount);
    event Sold(uint256 amount);
    event Burned(uint256 amount);
    event TradeRequest(address from, address to, address pet, uint value);
    event TradeFinished(address from, address to);
    event TradeDeclined(address from, address to, address pet, uint value);

    constructor() {
        token = new PetToken();
        owner = msg.sender;
    }


    function buyToken() payable public {
        uint256 amountToBuy = msg.value;
        //can spend 1/10 ether
        require(amountToBuy % 100000000000000000 == 0, "No Division!");
	    require(amountToBuy > 0, "You need to send some ether");

	    token.mintToken(msg.sender, TOKEN_PRICE_BUY*amountToBuy/1000000000000000000);
	    emit Bought(TOKEN_PRICE_BUY*amountToBuy/1000000000000000000);
    }

    function sellToken (uint256 amount) public {
        require(amount > 0, "You need to send some ether");
        require((amount/TOKEN_PRICE_SELL*1000000000000000000) % 100000000000000000 == 0, "No Division!");

	    token.burnToken(msg.sender, amount);

	    payable(msg.sender).transfer(amount/TOKEN_PRICE_SELL*1000000000000000000);
	    emit Sold(amount/TOKEN_PRICE_SELL*1000000000000000000);
    }

    function burnToken (uint256 amount, address user) public {
        require(amount > 0, "You need to send some ether");
        require((amount/TOKEN_PRICE_SELL*1000000000000000000) % 100000000000000000 == 0, "No Division!");

        //called from ATM or pet owner
        if(msg.sender == address(this) || petOfUser[user][msg.sender]){
            token.burnToken(user, amount);
            emit Burned(amount);
        }
        else{
            revert("You don't have access to burn tokens of user!");
        }
    }

    function getTokenAmount () external view returns(uint256) {
        return(token.balanceOf(msg.sender));
    }

    function getTradeRequests () external view returns(Trade[] memory) {
        return(buyerTrades[msg.sender]);
    }

    //pet functions
    function buyPet(string memory _petName) external {
        require(token.balanceOf(msg.sender) >= BASIC_PET_PRICE, "You don't have enough token!");
        token.burnToken(msg.sender, BASIC_PET_PRICE);
        VirtualPet pet = new VirtualPet(msg.sender, string(_petName));
        pets[msg.sender].push(address(pet));
        petOfUser[msg.sender][address(pet)] = true;
    }

    function updatePet(address _pet) external {
        require(petOfUser[msg.sender][address(_pet)] == true, "You don't own this pet!");
        VirtualPet(_pet).update(msg.sender);
    }

    function getPetLevel(address  _pet) external view returns(uint) {
        require(petOfUser[msg.sender][address(_pet)] == true);
        return VirtualPet(_pet).petLevel();
    }

    function getAllPets() external view returns(address[] memory) {
        return pets[msg.sender];
    }

    function sellPet(address _pet, address _to, uint _value) external {
        require(petOfUser[msg.sender][address(_pet)] == true, "You don't own this pet!");
        require(activeTrade[_to][msg.sender] == false, "You already have an open trade request!");
        activeTrade[_to][msg.sender] = true;
        //to access trades in frontend
        sellerTrades[msg.sender].push(Trade(_to, _pet, _value));
        buyerTrades[_to].push(Trade(msg.sender, _pet, _value));

        petTrade[msg.sender][_to][_pet][_value] = TradeState.REQUEST;
        emit TradeRequest(msg.sender, _to, _pet, _value);
    }

    function acceptPetTrade (address _pet, address _seller, uint _value) external {
        require(token.balanceOf(msg.sender) >= _value, "You don't have enough token!");
        require(petTrade[_seller][msg.sender][_pet][_value] == TradeState.REQUEST, "Trade doesn't exist or in wrong state!");

        token.burnToken(msg.sender, _value);
        token.mintToken(_seller, _value);
        petTrade[_seller][msg.sender][_pet][_value] = TradeState.DONE;
        activeTrade[msg.sender][_seller] = false;

        address newOwner = VirtualPet(_pet).changeOwner(msg.sender);

        //delete previous owner's pet
        for (uint i = 0; i < pets[_seller].length; i++) {
            if (pets[_seller][i] == _pet) {
                pets[_seller][i] = pets[_seller][pets[_seller].length - 1];
                pets[_seller].pop();
                break;
            }
        }

        //delete Seller Trade
        for (uint i = 0; i < sellerTrades[_seller].length; i++) {
            if (sellerTrades[_seller][i].tradePartner == msg.sender) {
                sellerTrades[_seller][i] = sellerTrades[_seller][sellerTrades[_seller].length - 1];
                sellerTrades[_seller].pop();
                break;
            }
        }

        //delete Buyer Trade
        for (uint i = 0; i < buyerTrades[msg.sender].length; i++) {
            if (buyerTrades[msg.sender][i].tradePartner == _seller) {
                buyerTrades[msg.sender][i] = buyerTrades[msg.sender][buyerTrades[msg.sender].length - 1];
                buyerTrades[msg.sender].pop();
                break;
            }
        }


        //set new pet owner
        petOfUser[_seller][_pet] = false;
        pets[msg.sender].push(_pet);
        petOfUser[msg.sender][_pet] = true;



        if(newOwner == msg.sender){
            emit TradeFinished(_seller, msg.sender);
        }
    }

    function declinePetTrade (address _pet, address _seller, uint _value) external {
        require(petTrade[_seller][msg.sender][_pet][_value] == TradeState.REQUEST, "Trade doesn't exist or in wrong state!");
        require(activeTrade[msg.sender][_seller] == true, "No active trade found!");
        petTrade[_seller][msg.sender][_pet][_value] = TradeState.DONE;
        activeTrade[msg.sender][_seller] = false;

        // //delete Seller Trade
        // for (uint i = 0; i < sellerTrades[_seller].length; i++) {
        //     if (sellerTrades[_seller][i].tradePartner == msg.sender) {
        //         sellerTrades[_seller][i] = sellerTrades[_seller][sellerTrades[_seller].length - 1];
        //         sellerTrades[_seller].pop();
        //         break;
        //     }
        // }

        // //delete Buyer Trade
        // for (uint i = 0; i < buyerTrades[msg.sender].length; i++) {
        //     if (buyerTrades[msg.sender][i].tradePartner == _seller) {
        //         buyerTrades[msg.sender][i] = buyerTrades[msg.sender][buyerTrades[msg.sender].length - 1];
        //         buyerTrades[msg.sender].pop();
        //         break;
        //     }
        // }

        emit TradeDeclined(_seller, msg.sender, _pet, _value);
    }

    //remove Pet (if pet dies the dead pet is displayed. just when removed it is deleteed from pets[msg.sender])


    function payout(uint256 _amount) external {
        require(msg.sender == owner);
        require(_amount <= address(this).balance);
        payable(owner).transfer(_amount);
    }

}

library Search {
     struct Trade { 
        address tradePartner;
        address pet;
        uint price;
    }

    function indexOf(Trade[] storage sellerTrades) public view returns (uint) {
        for (uint i = 0; i < sellerTrades.length; i++) {
                if (sellerTrades[i].tradePartner == msg.sender) {
                    return i;
                }
        }
    }
}
